import React from "react";

const App = () => {
  const changeName = () => {
    let name = "Akobir Ziyodullayev";
    return name;
  };

  return (
    <div>
      <div>
        <div className="akobir"></div>
        <div className="ravshan"></div>
        <button onClick={changeName}>Click Me!</button>
      </div>
    </div>
  );
};

export default App;
